import React from 'react';

const DeliveryBy = ({ logoUrl, dispensaryName }) => {
  return (
    <div className="text-center mt-3">
      <p className="mb-1" style={{ fontSize: '0.85rem', fontWeight: 'bold' }}>
        From
      </p>
      <div className="d-flex align-items-center justify-content-center">
        {/* Vendor Logo */}
        <img
          src={logoUrl || '/placeholder-logo.png'}
          alt={dispensaryName}
          style={{
            width: '30px',
            height: '30px',
            borderRadius: '50%',
            objectFit: 'cover',
            marginRight: '5px',
          }}
        />
        {/* Vendor Name */}
        <span style={{ fontSize: '0.85rem', fontWeight: 'bold', color: '#555' }}>
          {dispensaryName}
        </span>
      </div>
    </div>
  );
};

export default DeliveryBy;
